exports=async function(bid,options){const{parseUpdate}=await require("transcode/parse_update"),url=`http://www.lishu123.com/${bid.idPrefix()}/${bid}/`;return parseUpdate(url,html=>({name:html.subRegexLast(/li><a [^>]*href="[^"]+\d+\.html">([^<]+)</g)}),{clientOptions:{...(options&&options.clientOptions),encoding:"gbk","x-mobile":0}})};